import React from "react";
import { View, Text, StyleSheet } from "react-native";
const ManageMenu = ({ navigation }) => {
  return (
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Text>ManageView</Text>
    </View>
  );
};
export default ManageMenu;
